import React from 'react';
import Head from 'next/head';
import { Row, Col } from 'antd';
import AppLayout from '../components/AppLayout';

const Rank = () => (
  <>
    <Head>
      <title>Study Board | Rank</title>
    </Head>
    <AppLayout>
      <div style={{ width: '70%', margin: '30px auto' }}>
        <Row gutter={[32, 24]}>
          <Col span={12}>1</Col>
          <Col span={12}>2</Col>

          <Col span={12}>3</Col>
          <Col span={12}>4</Col>
        </Row>
        <Row gutter={[32, 24]}>
          <Col span={12}>5</Col>
          <Col span={12}>6</Col>
        </Row>
      </div>

    </AppLayout>
  </>
);

export default Rank;
